Submete à apreciação dos membros do Congresso Nacional Portarias que renovam autorizações outorgadas às entidades abaixo relacionadas para executarem, pelo prazo de dez anos, sem direito de exclusividade, serviços de radiodifusão comunitária, conforme os seguintes atos:

 - TVR 2/2021 - Portaria nº 1.833, de 09 de maio de 2016 - Associação Social e Beneficente de Alagoinhas, no município de Alagoinhas - BA;
 - TVR 3/2021 - Portaria nº 4.304, de 27 de agosto de 2019 - Associação Beneficente e Cultural Rádio Comunitária Voz das Rocas - RCR, no município de Natal - RN;
 - TVR 4/2021 - Portaria nº 4.871, de 19 de setembro de 2019 - Associação Pedrense de Eventos Comunitários, no município de Pedra - PE;
 - TVR 5/2021 - Portaria nº 5.178, de 04 de outubro de 2019 - Associação Comunitária Cultural Filadélfia, no município de Tucuruí - PA.

